export const getProducts = (id) => {
    return ( 
        fetch(`https://yalantis-react-school-api.yalantis.com/api/v1/products?page=${id}&perPage=${id}`
            )
            .then((result) => result.json())
            .then((result) => {
                return result;
            })
            .catch((error) => {
                return error
            })
    )
}
